import piggyBank from '../Images/piggy-bank.jpeg';
function Home() {
  return (

    <div className="container mx-auto  px-4 bg-[#7F3DFF] mt-40'">
      <div><p className='text-white'>Let's Start!</p></div>
      <p className='text-white title'>Let's Start!</p>
      <img  src={piggyBank} alt="Piggy Bank" />
    </div>



  );
}

export default Home;
